import React from 'react';

function Button({ children, primary }) {
  return (
    <button style={primary ? styles.primaryButton : styles.secondaryButton}>
      {children}
    </button>
  );
}

const styles = {
  primaryButton: {
    backgroundColor: '#007bff',
    color: 'white',
    padding: '0.5rem 1rem',
    border: 'none',
    borderRadius: '4px',
    cursor: 'pointer',
    marginLeft: '0.5rem',
  },
  secondaryButton: {
    backgroundColor: 'white',
    color: '#007bff',
    padding: '0.5rem 1rem',
    border: '1px solid #007bff',
    borderRadius: '4px',
    cursor: 'pointer',
    marginLeft: '0.5rem',
  },
};

export default Button;
